INSERT INTO books(title,book_id,author,description,price,rating,img,quantity) VALUES('The Monk Who Sold His Ferrari','BOOKS-10006',' Robin Sharma ','A renowned inspirational fiction, The Monk Who Sold His Ferrari is a revealing story that offers the readers a simple yet profound way to live life. The plot of this story revolves around Julian Mantle, a lawyer who has made his fortune and name in the profession. A sudden heart-attack creates havoc in the successful lawyer?s life. Jolted by the sudden onset of the illness, his practice comes to a standstill. He ponders over material success being worth it all, renounces all of it and leaves for India. A visit to India about a spiritual awakening that opens up new vistas and Julian begins to view life in a different perspective. He decides to live his life once again but in a way that is much more fulfilling and meaningful than before.',1699,5,'https://m.media-amazon.com/images/I/61pZyTuNDYL._SY522_.jpg',5);
